function Hero() {
  return (
    <section className="bg-[#EFE7DB] py-20 text-center">
      <h1 className="text-6xl font-extrabold text-[#2E563F]">
        Your Online Bookstore
      </h1>

      <p className="max-w-2xl mx-auto mt-4 text-[#4A5C4F] text-xl">
        Browse through our hand-picked collection of best-selling and inspiring
        books.
      </p>

      <button className="mt-8 bg-[#2E563F] px-8 py-3 rounded-xl text-white font-semibold hover:bg-[#244C36]">
        Start Reading
      </button>
    </section>
  );
}

export default Hero;
